import React, { Component } from "react";

export class DataTable extends Component {
  state = {
    data: []
  };

  render() {
    let personalData = this.state.data;
    return (
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Age</th>
            <th>Eye color</th>
            <th>Gender</th>
            <th>Company</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Address</th>
          </tr>
        </thead>
        <tbody>
          {personalData.map(person => {
            return 
            <tr key={person._id}>
                <td>{person.name}</td>
                <td>{person.age}</td>
                <td>{person.eyeColor}</td>
                <td>{person.gender}</td>
                <td>{person.company}</td>
                <td>{person.email}</td>
                <td>{person.phone}</td>
                <td>{person.email}</td>
            </tr>;
          })}
        </tbody>
      </table>
    );
  }
}

export default DataTable;
